const theme = createTheme({
  color: {
    primary: {
      light: '#70c3ff',
      main: '#4db5ff',
      dark: '#1f1f38',
      contrastText: '#fff'
    },
    secondary: {
      main: '#2c2c6c',
      contrastText: '#fff'
    },
    text: '#fff',
  }
});

function App() {
  return (
    <ThemeProvider theme={theme}>
      <Provider>
        <Header />
        <Routes>
  <Route path="/" component={ Home } />
       <Route path="/about" component={ About } />
         <Route path="/contact" component={ Contact } />
      <Route path="/skills" component={ Technologies } />
        </Routes>
      </Provider>
    </ThemeProvider>
  );
}

export default App
